import React from 'react';
import Header from '../Css/Header'; // Import the Header component
import Sidebar from '../Css/Sidebar'; // Import the Sidebar component

const CompanyDashboard = () => (
  <div className="dashboard">
    <Sidebar /> {/* Render the Sidebar component */}
    <div className="main">
      <Header /> {/* Render the Header component */}
      <div className="content">
        {/* Add the content specific to the Company Dashboard */}
        <h1>Company Dashboard</h1>
        <p>Welcome to the Company Dashboard page!</p>
      </div>
    </div>
  </div>
);

export default CompanyDashboard;
